import './App.css';
import * as React from 'react';
import { BrowserRouter as Router, Route, Switch } from 'react-router-dom'

import UserInfo from "./Components/UserInfo"
import Sample from './Components/Sample';
// import Sample from "./Components/Sample"

function App() {
  return (
    <div>
      <Router>
        <Switch>
          <Route path="/main">
            <UserInfo />
          </Route>
          <Route path="/sample">
            <Sample />
          </Route>
        </Switch>
      </Router>
    </div>
  );
}

export default App;
